Had some fun shooting this one and editing it with a technique that I hadn't used yet! After conversations I had with friends about mountain lions in the past few weeks, I was super paranoid hiking the 5 minutes from our tent to this spot continually looking around to make sure I didn't see any eyes staring at me. I'm definitely a little more skittish though, since I did have an experience where I saw two eyes while shooting the Milky Way in Colorado. Luckily it ended up being a buck, but I was pretty terrified that night! üò≥üòÇ";}i:212;a:1:{s:14:"comments_count";i:1;}i:213;a:1:{s:11:"likes_count";i:6;}i:214;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuPGT7nuzx";}i:215;a:1:{s:5:"image";s:250:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118775713_2713179582227795_7480641581160047420_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=sUddi7BtwuAAX8WyIlX&oh=389c05d5a16b7a520d8040c8372492a5&oe=5F7CD688";}i:216;a:1:{s:4:"type";s:7:"sidecar";}i:217;a:1:{s:8:"owner_id";i:276235761;}i:218;a:1:{s:14:"owner_username";s:0:"";}i:219;a:1:{s:14:"owner_fullname";s:0:"";}i:220;a:1:{s:9:"owner_pic";s:0:"";}i:221;a:1:{s:2:"id";s:19:"2390914826764622916";}i:222;a:1:{s:10:"short_code";s:11:"CEuPF4JhRxE";}i:223;a:1:{s:12:"created_time";i:1599239279;}i:224;a:1:{s:7:"caption";s:1944:"QVEVRI - clay vessel Georgia makes wine at.‚Å†
‚Å†
üç∑ Let's talk about the essential aspect of Georgian winemaking - qvevri, a huge egg-shaped clay vessel that makes our wine unique and different compared to others. ‚Å†
‚Å†
üç∑ All the fermentation process happens in qvevri, buried underground. That's why Georgian traditional, qvevri white wine has more of an amber color than pale yellow. ‚Å†
‚Å†
üç∑ Qvevri comes in different sizes - from tiny one as a souvenir to a 10 tone wine vessel. In the picture, Sergo, 5th generation qvevri-maker, is making the one that can fit around 2 tones of wine.‚Å†
‚Å†
üç∑ On the press trip with @Karavanly.official, I learned ins and outs of qvevri making that I had no idea of, especially how time consuming and hard to make it is. And I am sure, not many Georgians know this either üôà‚Å†
‚Å†
üç∑ It's a hard and time-consuming process to make a qvevri. Each day, 15-20 cm of local clay is added to shape and smooth the vessel. And it's not a one or two-man job either. ‚Å†Then it's dried for 3 weeks.
‚Å†
üç∑ After its finished drying, it needs to go into a special oven to bake at around 900 degrees C, which requires constant wood fire for 24 hours  for at least 5 days. 

üç∑After it's done baking, they pour over wax to seal and let them cool down on its own. 

üç∑ What makes this even more fascinating is that qvevri makera doesn't follow any calculations or measures, everything is done eying out! 
‚Å†
